import { useState, useEffect } from "react";
import "./Dashboard.scss";
import { jwtDecode } from "jwt-decode";
import Messages from "./../message/Message";
import { Link, useParams, useNavigate } from "react-router-dom";
import axios from "axios";

const Dashboard = () => {
  const [userInfo, setUserInfo] = useState(null);
  const [receivedMessages, setReceivedMessages] = useState([]);
  const [sentMessages, setSentMessages] = useState([]);
  const navigate = useNavigate();
  const { userId } = useParams();

  const fetchMessages = async () => {
    try {
      const receivedResponse = await axios.get(
        `/users/messages/received?token=${sessionStorage.getItem("token")}`
      );
      setReceivedMessages(receivedResponse.data.messages);

      const sentResponse = await axios.get(
        `/users/messages/sent?token=${sessionStorage.getItem("token")}`
      );
      setSentMessages(sentResponse.data.messages);
    } catch (error) {
      console.error("Błąd podczas pobierania wiadomości:", error.response.data);
    }
  };

  useEffect(() => {
    const token = sessionStorage.getItem("token");

    if (token) {
      const decodedToken = jwtDecode(token);

      setUserInfo(decodedToken);
      fetchMessages(); // Dodane automatyczne pobieranie wiadomości po zalogowaniu
    }
  }, []);

  const handleLogout = () => {
    // Usuń token z sessionStorage
    sessionStorage.removeItem("token");
    // Przekieruj użytkownika na stronę logowania
    navigate("/");
  };

  const handleRefreshReceived = () => {
    fetchMessages(); // Pobranie odebranych wiadomości po kliknięciu przycisku "Odśwież"
  };

  const handleRefreshSent = () => {
    fetchMessages(); // Pobranie wysłanych wiadomości po kliknięciu przycisku "Odśwież"
  };

  return (
    <div className="dashboard-container">
      <div className="user-info">
        {userInfo && (
          <p>
            Zalogowany użytkownik: {userInfo.name} (
            {userInfo.admin ? "Admin" : "Standardowy użytkownik"})
          </p>
        )}
        <button onClick={handleLogout}>Wyloguj</button>{" "}
      </div>
      <div className="received-mess">
        <h1>
          Odebrane <button onClick={handleRefreshReceived}>Odśwież</button>
        </h1>
        <Messages userId={userId} messages={receivedMessages} />
        <div className="messages"></div>
      </div>
      <div className="send-mess">
        <Link to="/NewMessage">Nowa Wiadomość</Link>
      </div>
      <div className="sent-mess">
        <h1>
          Wysłane <button onClick={handleRefreshSent}>Odśwież</button>
        </h1>
        <Messages userId={userId} messages={sentMessages} />
        <div className="messages"></div>
      </div>
    </div>
  );
};

export default Dashboard;
